import math, time

# Calculate binomial coefficient
def binomial_coeff(n, k):
    return math.comb(n, k)

# Generate polynomial Bézier curve point for any number of control points
def polynomial_bezier_point(t, control_points):
    n = len(control_points) - 1
    x, y = 0, 0
    for i, (px, py) in enumerate(control_points):
        coeff = binomial_coeff(n, i) * ((1 - t) ** (n - i)) * (t ** i)
        x += coeff * px
        y += coeff * py
    return (x, y)

# Compute Bézier curve points with the polynomial method
def compute_polynomial_bezier_curve(control_points, steps=1000):
    curve_points = []
    for t in [i / steps for i in range(steps + 1)]:
        point = polynomial_bezier_point(t, control_points)
        curve_points.append(point)
    return curve_points

